@Andrew - I had reverted this change in the latest patch , we are now not preserving the path anymore. while testing the changes I found that most of the apps are using libpldm/<.h> -> even for the .h files from the oem directory.if we want to make that work with preserving path's the only way to make it work is by symlinking all the oem header files into root libpldm directory as well & that made things cumbersome. So I decided to NOT preserve path.

So with the new change, both the libpldm generic & oem headers will be installed in 
libpldm directory itself. But this would add the restriction on not having same file name for both the generic & oem headers - as we are already using _oem as a suffix for the oem headers ,I suppose this would not be a problem ?
